n// }","@mixin button {\n  --button-text: null;\n  --button-font-weight: var(--font-weight-bold);\n  --button-radius: var(--radius);\n\n  display: inline-flex;\n  align-items: center;\n  justify-content: center;\n  min-width: 6rem;\n  height: var(--size-large);\n  padding: 1px var(--space-4) 0;\n  border-radius: var(--radius);\n  box-sizing: border-box;\n  font-weight: var(--font-weight-bold);\n  position: relative;\n\n  @content;\n  &:hover:not(:disabled), &.is-hover:not(:disabled) {\n    box-shadow: var(--state-hover);\n  }\n  &:focus, &.is-focus {\n    outline: 0;\n    box-shadow: var(--state-focus); // hover override\n  }\n  // &:active {outline:0;animation:ripple2 0.2s linear forwards;}\n  &:visited {}\n  &:disabled {opacity:.5;cursor:not-allowed;}\n}\n\n// ! role=button => spacebar X\n// button:not(:active),\n// button:not(:focus) {outline:0;}\n// button:before {content:'';display:block;width:8px;height:8px;background:rgba(0,0,0,.2);position:absolute;left:50%;top:50%;transform:translate(-50%,-50%);opacity:0;}\n// button:active:before {width:100%;height:100%;animation:ripple .6s;}\n\n// &[aria-pressed=true] {}\n// &[aria-pressed=false] {}\n// &[aria-current] {}\n// &[aria-current=page] {}\n\n// 믹스인은 버튼-프라이머리를 가져다 쓰기 위해서인데, css 정책을 완전 바꿔야 할 것 같다. utility => componenet.\n\n@minxin button-container {\n\n}\n\n@mixin button-primary {\n  @include button {\n    background: var(--color-primary);\n    border:1px solid var(--color-primary);\n    color: #fff; // 다크테마와 동일한 스타일\n  }\n}\n@mixin button-secondary {\n  @include button {\n    border:1px solid transparent;\n    background:var(--green100);color:var(--color-primary);\n  }\n  }\n@mixin button-tertiary {\n  @include button {\n    border: 1px solid var(--color-background-weak);\n    background:var(--color-background-weak);\n    color:var(--color-text);\n  }\n}\n@mixin button-text {\n  @include button {\n    border:1px solid transparent;color:var(--color-primary);\n  }\n}\n\n.button-primary {@include button-primary;}\n.button-secondary {@include button-secondary;}\n.button-tertiary {@include button-tertiary;}\n.button-text {@include button-text;}\n\n// 이거 이름 바꿨을 때 의존서이 너무 큼. mixin\n\n@mixin icon-indicator {@include avatar-small;background-image:none;\n.material-symbols-outlined {\n  font-size: 1rem;\n}}\n.icon-indicator {@include icon-indicator;}\n  // span {font-size:20px;}\n\n.danger-button {@include button;background:var(--red800);border:1px solid var(--red800);color:var(--gray0);}\n\n\nclose-button {position:absolute;right:var(--space-2);top:var(--sopace-2);}","@mixin reset-textinput {\n  background: var(--color-background-weak);\n  border: 1px solid transparent;\n  border-radius: var(--radius);\n  box-sizing: border-box;\n  font: inherit;\n  color: var(--color-text); // for safari #fff\n}\n\n// input:-internal-autofill-selected {}\n\n@mixin textfield-prefix {@include icon-indicator;position:absolute;left:var(--space-3);top:36px;}\n@mixin textfield-surfix {@include icon-indicator;position:absolute;right:var(--space-3);top:33px;}\n\n.textfield-group {display:flex;justify-content:space-between;}\n.textfield-group .textfield {width:calc(50% - var(--space-1))}\n\n.textfield {position:relative;}\n\n.textfield-label {display:block;}\n.textfield-label small {margin:0 0 0 var(--space-1);color:var(--color-text-light);}\n\n.textfield-input {@include reset-textinput;display:block;width:100%;height:var(--size-large);padding:var(--space-2) var(--space-4);}\n.textfield-input:focus {outline:0;background:var(--color-background);box-shadow:var(--state-hover);}\n.textfield-input:disabled {border-color:var(--gray200);background:var(--gray200);color:var(--gray100);cursor:not-allowed;}\n.textfield-input:read-only {color:var(--color-text-light);cursor:default;}\n\n\n.textfield-link {@include link-outside;font-size:var(--font-size-small);position:absolute;right:0;top:0;}\n.textfield-helper {margin-top:.25rem;color:var(--red800);}\n\n.textfield-reveal {@include textfield-surfix;width:auto;font-size: